import React from "react";

function LeftBar(){
    return (
        <header class=" text-white h-12 py-4">
            <div class="overflow-y-auto fixed h-screen truncate resize-none">
            <div className="overflow-x-none md:p-10 flex items-center">

            </div>  
            </div>
        </header>
    )
};

export default LeftBar;
